import React from 'react'
import {Route,Switch,Router, Routes} from 'react-router-dom'
import CompA from './CompA'
const Router1 = () => {
  return (
    <>
    <Switch>
      <Route path='/' component={CompA} />
    </Switch>
    </>
  )
}

export default Router1
